Sabe aquele bolo de banana que a gente AMA? Fiz ele na versão vegan 😍
Anota aí:
- Para substituir os ovos usei linhaça hidratada: 3 colheres de sopa de semente de linhaça dourada + 9 colheres de sopa de água; deixei hidratando por 15 minutos.
- 4 bananas caturra, maduras;
- 1 xícara de uva passa;
- 1/2 xícara de óleo de coco líquido;
- 1 xícara de farelo de aveia;
- 1 xícara de aveia em flocos;
- 1 colher de sopa de fermento em pó;
- 1 colher de sopa de psyllium .
🍰Bater no liquidificador: os "ovos de linhaça", as bananas, o óleo de coco e as uvas. Colocar essa massa em um recipiente e acrescentar a aveia em flocos e farelo, o fermento e o psyllium. Por cima coloquei banana e se quiser, polvilhe canela - assar em temperatura baixa, por aproximadamente 60 minutos. Fica uma massa mais úmida e deliciosa 😍♥️

